sources.sass/layout/layout.scss:
 body{
   margin: 0;
   padding:0;
 }

 $primarycolor: #36BDCB;
 $secondarycolor: #D9F7FA;
 $thirdcolor:  #F6D6FC;
 $fourthcolor: #FFD9C9;
 $fifthcolor: #FFFFC4;
 $footercolor: #677577;

//  Choisir le modle

.choose{
  background-color: $thirdcolor;
  color: $primarycolor;
  text-align: center;
  padding-top:15px;
  padding-bottom: 15px;
    font-size: 24px;
    .button__choose{
      background-color: $primarycolor;
      border: none;
      color: #FFFFFF;
      height: 9.47vh;
      width: 53.33vw;
      font-size: 14px;
      border-radius: 20.5px;
    }
    .choose__blue{
      font-size: 18px;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
    .choose__dark{
      font-size: 18px;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
    .blue__jacket, .dark__jacket{
      height: 46vh;
      width: auto;
    }
}

// Fans 

.fans{
  background-color: $secondarycolor;
  height: 97.44vh;
  color: $primarycolor;
  text-align: center;
  padding-top: 15px;
  .fans__img{
    display: grid;
    grid-template-columns: 1fr 1fr;
    grid-gap: 15px;
    grid-template-rows: 1fr 1fr;
    margin-left: 50px;
    padding-top: 55px;
  }
  .button__fans{
    background-color: $primarycolor;
      border: none;
      color: #FFFFFF;
      height: 9.47vh;
      width: 53.33vw;
      font-size: 10px;
      border-radius: 20.5px;
      margin-top: 10px;
  }
}

.star1{
  height: 17.85vh;
  width: auto;
  grid-column: 1 / 2;
  grid-row: 1 / 2;
}

.star2{
  height: 17.85vh;
  width: auto;
  grid-column: 2 / 2;
  grid-row: minmax (100px, auto);
}

.star3{
  height: 17.85vh;
  width: auto;
  grid-column: 1 / 2;
  grid-row: 2 / 2;
}

.star4{
  height: 17.85vh;
  width: auto;
  grid-column: 2 / 2;
  grid-row: 2 / 2;
}
 //  Footer

.footer{
  height: 9.95vh;
  width: 100vw;
  background-color: $footercolor;
  display: flex;
  flex-direction: row;
  // padding-top: 4vh;
  .text__footer{
    font-size: 10px;
    width:24vw;
    display: flex;
    flex-direction: column;
    justify-content: center;
    color: #FFFFFF;
  }
  .icons__footer{
    justify-content: center;
    font-size: 10px;
    width:52vw;
    margin-top: 3vh;
    color: #FFFFFF;
  }
  .text__footer1{
    width: 24vw;
    font-size: 10px;
    text-align: center;
    display: flex;
    flex-direction: column;
    justify-content: center;    
    color: #FFFFFF;
  }
}
